import React from 'react';
import { NavLink } from 'react-router-dom';

const Navigation = () => {
  return (
    <nav>
      <NavLink
        to="/register"
        className={({ isActive }) => (isActive ? 'active' : '')}
      >
        Register
      </NavLink>
      <NavLink
        to="/login"
        className={({ isActive }) => (isActive ? 'active' : '')}
      >
        Login
      </NavLink>
      <NavLink
        to="/contacts"
        className={({ isActive }) => (isActive ? 'active' : '')}
      >
        Contacts
      </NavLink>
      {/* Add more navigation links as needed */}
    </nav>
  );
};

export default Navigation;
